import React from 'react';

import Grid from '@material-ui/core/Grid';
import Clock from './Clock'
import DateViewer from './DateViewer'

import './DateContainer.css'
const section = {
    minHeight: "200px",
    paddingTop: 5,
  };

export default class DateContainer extends React.Component {
    render() {
        return (
            <Grid item xs={12}>
                <div style={section}>
                    <Grid container spacing={1}>
                        <Grid item xs={6}>
                            <Clock timezone="Europe/Stockholm"/>
                            <DateViewer />
                        </Grid>
                        <Grid item xs={6}>
                            <Grid item xs={6}>
                                <div>
                                BKK <Clock timezone="Asia/Bangkok"/>
                                </div>
                            </Grid>
                            <Grid item xs={6}>
                                <Clock timezone="Asia/Bangkok"/>
                            </Grid>
                        </Grid>
                    </Grid>
                </div>
            </Grid>

        );
    }
}
